    @Test
    fun backupTest() = runBlocking {
        `when`(pluto.getAllDIDs()).thenReturn(flow { emit(Json.decodeFromString<List<DID>>(getDids)) })
        `when`(pluto.getAllCredentials()).thenReturn(
            flow {
                emit(
                    Json.decodeFromString<List<CredentialRecovery>>(
                        getCredentials
                    )
                )
            }
        )
        `when`(pluto.getAllDidPairs()).thenReturn(flow { emit(Json.decodeFromString<List<DIDPair>>(getDidPairs)) })
        `when`(pluto.getAllKeysForBackUp()).thenReturn(
            flow {
                emit(
                    Json.decodeFromString<List<BackupV0_0_1.Key>>(
                        getPrivateKeys
                    )
                )
            }
        )
        `when`(pluto.getLinkSecret()).thenReturn(flow { emit(Json.decodeFromString<String?>(getLinkSecret)) })
        `when`(pluto.getAllMessages()).thenReturn(flow { emit(Json.decodeFromString<List<Message>>(getMessages)) })
        `when`(pluto.getAllMediators()).thenReturn(flow { emit(Json.decodeFromString<List<Mediator>>(getMediator)) })

        `when`(
            apollo.createPrivateKey(
                mapOf(
